import React, { useEffect } from 'react';
import './App.css';

function App() {

  useEffect(() => {
    fetch('http://localhost:8080/college-essay')
        .then((response) => response.json())
        .then((data) => console.log(data));
  }, []);

  return (

    <div className="App">
        <div className="response"></div>
    </div>
  );
}

export default App;
